import React from 'react';
import { Link } from 'react-router-dom';

function Home() {
  return (
    <div>
      <h1>Bienvenido a San Martín</h1>
      <p>Tu plataforma de compras eléctricas.</p>
      <Link to="/login">Iniciar Sesión</Link>
    </div>
  );
}

export default Home;
